const { Title } = Typography;

const IndexPage = ({props}) => {
    return (
        <div>
            여기에는 회사의 소개 페이지가 들어갈 예정입니다.
            회사 소개와 회사 위치만 들어갈 예정입니다.
            1987 company 소개
            <hr />
        </div>
    )
  }

  export default IndexPage;
